import React, { Component } from "react";

import Navbar from "../Components/Navbar.js";
import Login from "../Components/Login.js";
import Register from "../Components/Register.js";

class LandingPage extends Component {
	constructor(props) {
		super(props);
		this.state = {
    	isRegistered: true
  	};
  }

	render() {
		return (
			<div>
				<Navbar isLoggedIn={this.props.isLoggedIn}/>
				<div className="container">
					<h2 className="welcomeBanner">Welcome to NoteFinder at NDNU!</h2>
					<div className="PLogo float-left">
            <img src={personNotes} width="500" height="325"/>
          </div>
          {this.state.isRegistered ? (
          	<Login isRegistered = {this.state.isRegistered} />
          	) : (
          	<Register isRegistered = {this.state.isRegistered} />
          	)
          }
				</div>
				<Footer isLoggedIn = {this.state.isLoggedIn} />
			</div>
		);
	}
}
export default LandingPage;
